import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { Badge, Row, Col, Button } from "react-bootstrap";

import "../../styles/screens/GroupsScreens.css";
import Message from "../Message";
import AlertMessage from "../AlertMessage";
import { getGroupExpenses } from "../../actions/groupActions";

function ExpenseList() {
    // group id
    const { id } = useParams();
    const dispatch = useDispatch();

    const groupExpenses = useSelector((state) => state.groupExpenses);
    const {
        error: groupExpensesError,
        loading: groupExpensesLoading,
        groupExpensesList,
    } = groupExpenses;

    console.log(groupExpensesList);

    // const [isGroupNameUpdated, setIsGroupNameUpdated] = useState(false);

    useEffect(() => {
        dispatch(getGroupExpenses(id));
    }, [dispatch, id]);

    return (
        <div className="expense-list">
            {groupExpensesLoading ? (
                <div>Loading...</div>
            ) : groupExpensesError ? (
                <Message variant="danger">{groupExpensesError}</Message>
            ) : groupExpensesList.length === 0 ? (
                <p>No expenses</p>
            ) : (
                <div className="">
                    <Row className="d-flex flex-row justify-content-center ">
                        <Col
                            xs={2}
                            sm={2}
                            md={1}
                            className="expense-list-col d-flex flex-row align-items-center justify-content-center"
                        >
                            Type
                        </Col>
                        <Col
                            xs={2}
                            sm={2}
                            md={1}
                            className="expense-list-col d-flex flex-row align-items-center"
                        >
                            <span>Payer</span>
                        </Col>
                        <Col
                            xs={4}
                            sm={4}
                            md={5}
                            className="expense-list-col d-flex flex-row align-items-center"
                        >
                            <span>Description</span>
                        </Col>
                        <Col
                            xs={2}
                            sm={2}
                            md={2}
                            className="expense-list-col d-flex flex-row align-items-center "
                        >
                            <span>Amount</span>
                        </Col>
                        <Col
                            xs={2}
                            sm={1}
                            md={2}
                            className="expense-list-col d-flex flex-row align-items-center "
                        >
                            <span>Date</span>
                        </Col>
                        <Col
                            xs={4}
                            sm={1}
                            md={1}
                            className="expense-list-col d-flex flex-row align-items-center justify-content-center py-2"
                        >
                            <div></div>
                        </Col>
                    </Row>
                    {groupExpensesList.map((expense) => (
                        <div key={expense.id} className="expense-row">
                            <Row className="d-flex flex-row justify-content-center p-0 border-top border-primary">
                                <Col
                                    xs={2}
                                    sm={2}
                                    md={1}
                                    className="expense-list-col d-flex flex-row align-items-center justify-content-center"
                                >
                                    <Badge pill bg="primary">
                                        Expense
                                    </Badge>
                                </Col>
                                <Col
                                    xs={2}
                                    sm={2}
                                    md={1}
                                    className="expense-list-col d-flex flex-row align-items-center"
                                >
                                    <span>{expense.payer.name}</span>
                                </Col>
                                <Col
                                    xs={4}
                                    sm={4}
                                    md={5}
                                    className="expense-list-col d-flex flex-row align-items-center"
                                >
                                    <span>{expense.description}</span>
                                </Col>
                                <Col
                                    xs={2}
                                    sm={2}
                                    md={2}
                                    className="expense-list-col d-flex flex-row align-items-center "
                                >
                                    <span>${expense.amount}</span>
                                </Col>
                                <Col
                                    xs={2}
                                    sm={1}
                                    md={2}
                                    className="expense-list-col d-flex flex-row align-items-center "
                                >
                                    <span>
                                        {new Date(
                                            expense.date
                                        ).toLocaleDateString()}
                                    </span>
                                </Col>
                                <Col
                                    xs={4}
                                    sm={1}
                                    md={1}
                                    className="expense-list-col d-flex flex-row align-items-center justify-content-center py-2"
                                >
                                    <Button>edit</Button>
                                </Col>
                            </Row>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
}

export default ExpenseList;
